import React from 'react'

import '../assets/landingPage.css';

const landingPage = () => {

    const headerStyle = {
        color: '#483D53',
        fontSize: '60px',
        letterSpacing: '2px',
        marginTop: '10%',
        position: 'relative'
    }

    const buttonStyle = {
        backgroundColor: '#483D53',
        border: 'none',
        padding: '14px 40px',
        width: '250px',
        position: 'absolute',
        marginTop: '5%',
        marginLeft: '-10%',
        cursor: 'pointer',
    }

    const anchorStyle = {
        color: '#FFFFFF',
        textDecoration: 'none',
        letterSpacing: '2px',
        fontSize: '20px',
        textAlign: 'center',
        display: 'inline-block',
    }

    return (
        <div>
            <h1 style={headerStyle}>
                SnapCode
            </h1>
            <button style={buttonStyle}>
                <a style={anchorStyle} href="/addCode"> Get Started! </a>
            </button>
        </div>
    )
}

export default landingPage;
